class Solution(object):
    def wordPattern(self, pattern, s):
        """
        :type pattern: str
        :type s: str
        :rtype: bool
        """

        s = s.split()
        if len(pattern) != len(s):
            return False
        d = {}
        for i in range(len(pattern)):
            if pattern[i] in d:
                if d[pattern[i]] != s[i]:
                    return False
            else:
                if s[i] in d.values():
                    return False
                d[pattern[i]] = s[i]
        return True

