class Solution(object):
    def numberOfArithmeticSlices(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        n = len(nums)
        if n < 3:
            return 0
        dp = [0] * n
        for i in range(n):
            for j in range(i):
                if nums[i] - nums[j] == nums[j] - nums[j - 1]:
                    dp[i] += dp[j - 1] + 1
        return sum(dp)

