class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        def isConcatenated(word, words):
            if word in words:
                return True
            for i in range(1, len(word)):
                left = word[:i]
                right = word[i:]
                if left in words and right in words:
                    return True
            return False

        words.sort(key=lambda x: len(x))
        ans = []
        for word in words:
            if isConcatenated(word, words):
                ans.append(word)
        return ans

