class Solution(object):
    def convertToBase7(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return "0"
        if num < 0:
            num = abs(num)
        ans = ""
        while num:
            ans = str(num % 7) + ans
            num //= 7
        return ans

